import axios from "axios";
import { AnimatePresence, motion } from "framer-motion";
import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import styled from "styled-components";

const Container = styled.div`
  position: relative;
  margin: auto;
  margin-bottom: 100px;
  margin-top: 30px;
  background-color: whitesmoke;
  border-radius: 10px;
  height: 380px;
  width: 90%;
  overflow: hidden;
  box-shadow: 0 2px 3px rgba(0, 0, 0, 0.1), 0 10px 20px rgba(0, 0, 0, 0.2);
  @media screen and (max-width: 700px) {
    height: 500px;
  }
`;

const Slider = styled(motion.div)`
  position: absolute;
  display: grid;
  grid-template-columns: repeat(4, 1fr);
  gap: 10px;
  width: 100%;
  text-align: center;
  @media screen and (max-width: 700px) {
    grid-template-columns: repeat(2, 1fr);
  }
`;

const PlaceBox = styled(motion.div)`
  position: relative;
  background-color: white;
  border-radius: 10px;
  overflow: hidden;
  cursor: pointer;
  box-shadow: 0 2px 3px rgba(0, 0, 0, 0.1);
`;

const Rating = styled.div`
  position: absolute;
  top: 10px;
  left: 10px;
  background-color: rgba(255, 0, 0, 1);
  border-radius: 50%;
  padding: 5px 10px;
  color: white;
  font-size: 16px;
`;

const InfoBox = styled.div`
  padding: 10px;
  text-align: left;
`;

const PlaceImg = styled.img`
  width: 100%;
  height: 200px;
  object-fit: cover;
  border-bottom: 1px solid #eee;
`;

const PlaceTitle = styled.div`
  font-size: 18px;
  font-weight: bold;
  margin-bottom: 5px;
`;

const PlaceLocation = styled.div`
  color: grey;
  margin-bottom: 5px;
`;

const PlaceMenu = styled.div`
  color: grey;
`;

const NextBtn = styled.img`
  width: 30px;
  position: absolute;
  right: 0;
  top: 50%;
  cursor: pointer;
`;

const PrevBtn = styled.img`
  width: 30px;
  position: absolute;
  left: 0;
  top: 50%;
  cursor: pointer;
`;

const SliderVar = {
  hidden: (isBack: boolean) => ({
    x: isBack ? -window.outerWidth + window.outerWidth / 10 : window.outerWidth - window.outerWidth / 10,
  }),
  visible: {
    x: 0,
  },
  exit: (isBack: boolean) => ({
    x: isBack ? window.outerWidth - window.outerWidth / 10 : -window.outerWidth + window.outerWidth / 10,
  }),
};

interface RestaurantForm {
  img: string;
  restaurantId: number;
  restaurantName: string;
  location: string;
  menu: string;
  views: number;
  likes: number;
  comments: number;
}

export default function WholePlace() {
  const [Index, setIndex] = useState(0);
  const [back, setBack] = useState(false);
  const [leaving, setLeaving] = useState(false);
  const [restaurantData, setRestaurantData] = useState<RestaurantForm[]>([]);
  const navigate = useNavigate();

  const nextPlease = async () => {
    if (leaving) return;
    toggleLeaving();
    await setBack(false);
    setIndex((prev) => (prev === restaurantData.length - 4 ? 0 : prev + 4));
  };
  const prevPlease = async () => {
    if (leaving) return;
    toggleLeaving();
    await setBack(true);
    setIndex((prev) => (prev === 0 ? restaurantData.length - 4 : prev - 4));
  };
  const toggleLeaving = () => setLeaving((cur) => !cur);

  const handleImageClick = (restaurantId: number) => {
    navigate(`/place/${restaurantId}`);
  };

  useEffect(() => {
    async function fetchRestaurant() {
      try {
        const response = await axios.get('/restaurantData');
        const shuffledImages = response.data.restaurantData.sort(() => Math.random() - 0.5);
        setRestaurantData(shuffledImages);
      } catch (error) {
        console.error('Error fetching restaurant data:', error);
      }
    }
    fetchRestaurant();
  }, []);

  return (
    <Container>
      <AnimatePresence initial={false} onExitComplete={toggleLeaving}>
        <Slider
          custom={back}
          variants={SliderVar}
          initial="hidden"
          animate="visible"
          exit="exit"
          transition={{ type: "tween", duration: 1 }}
          key={Index}
        >
          {restaurantData.slice(Index, Index + 4).map((restaurant, idx) => (
            <PlaceBox key={idx} whileHover={{ scale: 1.1 }} onClick={() => handleImageClick(restaurant.restaurantId)}>
              <PlaceImg src={restaurant.img} alt={restaurant.restaurantName} />
              <Rating>{restaurant.rating}</Rating>
              <InfoBox>
                <PlaceTitle>{restaurant.restaurantName}</PlaceTitle>
                <PlaceLocation>{restaurant.location}</PlaceLocation>
                <PlaceMenu>인기 메뉴: {restaurant.menu}</PlaceMenu>
                <div>조회수: {restaurant.views} 좋아요: {restaurant.likes} 댓글: {restaurant.comments}</div>
              </InfoBox>
            </PlaceBox>
          ))}
        </Slider>
        <PrevBtn src={process.env.PUBLIC_URL + "/back.png"} onClick={prevPlease} />
        <NextBtn src={process.env.PUBLIC_URL + "/next.png"} onClick={nextPlease} />
      </AnimatePresence>
    </Container>
  );
}



